class icstool extends React.Component {
    render() {
        <Container maxWidth="sm">
            <h1>解析結果</h1>

            <style global jsx>{`
                body {
                    background: #333333;
                }
                ::-webkit-scrollbar {
                    width: 5px;
                }
                ::-webkit-scrollbar-track {
                    -webkit-border-radius: 10px;
                    border-radius: 10px;
                    margin: 80px 0 5px 0;
                }
                ::-webkit-scrollbar-thumb {
                    -webkit-border-radius: 4px;
                    border-radius: 4px;
                    background: rgb(80, 80, 80);
                }
            `}</style>
        </Container>;
    }
}
